import React, { Component } from 'react';
import './App.css';
import ResumeDisplay from './ResumeDisplay'
import ResumeForm from './ResumeForm'

class App extends Component {

  constructor(){
    super()
    this.state = {
      resumes: []
    }
  }


  render() {

    return (
      <div>
        <ResumeForm resumes={this.state.resumes} addNewResume={this.addResumeToProfile}/>
      </div>
    )
  }
}



export default App;
